import React from 'react';
import './App.css';
import {Navbar, Nav, NavDropdown} from 'react-bootstrap';
import PuppyPage from './pages/PuppyPage';
import AboutPage from './pages/AboutPage';
import Gallery from './pages/Gallery';
import HomePage from './pages/HomePage';
import ReviewPage from './pages/ReviewPage';
import {BrowserRouter, Route, Link } from 'react-router-dom';
import data from './data';
import ContactPage from './pages/ContactPage';
function App() {
  return (
    <BrowserRouter>
    <Navbar fixed="top" />
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand> 
  <Link to="/"> Home Raised Cairns </Link>
  </Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link><Link to="/AboutPage"> About </Link></Nav.Link>
      <Nav.Link><Link to="/Contact"> Contact </Link></Nav.Link>
      <Nav.Link><Link to="/Gallery"> Gallery </Link></Nav.Link>
      <Nav.Link><Link to="/ReviewPage"> Cart </Link></Nav.Link>
      <NavDropdown.Divider />
      <Nav.Link><Link to="/SignPage"> Signin </Link></Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
    <div className="grid-container">

<main className="main">
    <div className="content">
    <Route path="/puppy/:id" component={PuppyPage} />
    <Route path="/" exact={true} component={HomePage} />
    <Route path="/review/:id?" component={ReviewPage} />
    <Route path="/AboutPage" component={AboutPage} />
    <Route path="/ContactPage" component={ContactPage} />
    <Route path="/Gallery" component={Gallery} />
</div>

</main>
    <footer className="footer">
        All rights reserved.
    </footer >
</div>
</BrowserRouter>
  );
}

export default App;
